import 'react-native-gesture-handler';
import React, {Component} from 'react';
import {View, Text} from 'react-native';
import MyButton from './MyButton';


const Home = () => {
    return(
        <View>
            <Text>CO2 Emission</Text>
            <MyButton />
        </View>

    )
}

export default Home;
